sources.styles/blocks/swiper.scss:
.swiper {
  grid-column: 1 / -1;
  width: 100%;
  padding-bottom: 43px;
  overflow: hidden;

  @include onDesktop {
    box-sizing: content-box;
    padding: 40px;
    margin: -40px;

    &__wrapper {
      @include pageGrid;
      row-gap: 30px;
      transform: unset !important;
    }
  }

  &__slide {
    position: relative;
    padding-bottom: 410px;

    img {
      position: absolute;
      z-index: 10;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      object-fit:cover;
      object-position: top;
      pointer-events: none;
      user-select: none;
      margin-bottom: auto;
    }

    @include onTablet {
      padding-bottom: 540px;
    }

    @include onDesktop {
      padding-bottom: 600px;

      &:first-child {
        grid-column: 1 / span 4;
      }

      &:nth-child(2) {
        grid-column: 5 / -1;
      }

      &:nth-child(3) {
        grid-column: 1 / span 8;
      }

      &:last-child {
        grid-column: 9 / -1;
      }

      width: unset !important;

      @include hover(transform, scale(1.05) translateZ(0));
      cursor: pointer;
    }
  }

  &-pagination-bullet {
    width: 10px;
    height: 10px;
    background-color: $color-dark-green-accent;
    margin: 0 10px !important;

    @include onTablet {
      margin: 0 15px !important;
    }
  }

  &__button {
    display: none;

    @include onTablet {
      display: flex;

      &::before {
        @include pseudo();
        height: 200px;
        width: 60px;
        background-color: #b19a9a;
        opacity: 0;
        transition: opacity 0.3s ease;
      }

      &::after {
        z-index: 1;
        color: $color-white;
        font-size: 60px;
      }

      &:hover::before {
        opacity: 0.8;
      }
    }

    @include onDesktop {
      display: none;
    }
  }

  &-button-prev {
    &::before {
      border-radius: 0 20px 20px 0;
    }
  }

  &-button-next {
    &::before {
      border-radius: 20px 0 0 20px;
    }
  }
}

